window.bookSummaryJSON = "<p><b>Build your kingdom - Destroy your enemies</b><br> </p> <p>What would you do if you woke up in a strange land?</p> <p>What if you had no idea why?</p> <p>Would you fight, or would you curl up into a ball and cry?</p> <p>What if your fate was sealed by a booming announcement that cracked across the vast blue skies?</p> <p>“Greetings, welcome to The Land of The Lessermen. You have arrived in the nick of time. War looms, its dire thunderheads crowding our once glorious sky. This land needs a strong hand such as yours. A hundred must battle for victory, and at the end, there can be only one.”</p> <p><b>You’ve played the games, now listen to the book!</b></p> <p>For Connor O’Grady this nightmare comes true. He wakes in a land and is propelled into an age called Legendary, where he has to fight his way up from nothing, literally nothing, not even a pair of pants.&nbsp;He must learn to survive, to fight, and to enlist the help of others in order to build a civilization capable of winning.</p> <p><b>Because there is no other option.</b></p> <p>This is a LitRPG - Civ building fantasy tale and includes progression stats and settlement stats.</p> <p>For lovers of 4X strategy MMORPG civilization building games who enjoy a tale woven in the lands they spend far too much time in.</p> <p><b>Warning: Contains curse words.</b></p>"; 
